import React, { Fragment } from 'react'
import PostCard from '../organism/post'

import {TPost, TPosts} from '../../type/post'

type TProps = {
    posts: TPosts
}

const PostTemplate:React.FC<TProps> = props => {
    return (
        <Fragment>
            {
                props.posts.map((post: TPost) => {
                    return (
                        <PostCard {...post} />
                    )
                })
            }
        </Fragment>
    )
}
export default PostTemplate
